Just after initializing the console capsule, we find this line: kernel::debug::assign_console_driver(Some(imix.console), kc); This configures the kernel's debug! macro to print messages to this console we've just created. The debug! mechanism can be very helpful during development and testing. Today we're going to use it to print output from the capsule you create. Let's try it out really quick: --- a/boards/imix/src/main.rs
+++ b/boards/imix/src/main.rs
@@ -10,7 +10,7 @@ extern crate capsules; extern crate cortexm4; extern crate compiler_builtins;
-#[macro_use(static_init)]
+#[macro_use(debug, static_init)] extern crate kernel; extern crate sam4l; @@ -388,6 +388,8 @@ pub unsafe fn reset_handler() { capsules::console::App::default()); kernel::debug::assign_console_driver(Some(imix.console), kc); + debug!("Testing 1, 2, 3...");
+ imix.nrf51822.initialize(); Compile and flash the kernel (make program) then look at the output (tockloader listen). What happens if you put the debug! before assign_console_driver? What happens if you put imix.console.initialize() after assign_console_driver? As you can see, sometimes there are dependencies between capsules, and board authors must take care during initialization to ensure correctness. Note: The debug! implementation is asynchronous . It copies messages into a buffer and the console prints them via DMA as the UART peripheral is available, interleaved with other console users (i.e. processes). You shouldn't need to worry about the mechanics of this for now.
